import React from 'react';
import styled from 'styled-components/macro';

import EditablePane from './components/EditablePane';
import { mainTheme } from './styles/colors';

import { H1Style } from './styles/headings';

const App = () => {
  return (
    <AppContainer id='app-outer-boundary'>
      <Column>
        <EditablePane>
          <SectionTitle>
            Hours of Operation
          </SectionTitle>
        </EditablePane>
        <EditablePane>
          <SectionTitle>
            Branding
          </SectionTitle>
        </EditablePane>
      </Column>
    </AppContainer>
  );
};

export default App;

const AppContainer = styled.div`
  display: flex;
  flex-direction: row;
  width: 100vw;
  min-height: 100vh;

  padding: 24px;
`;

const Column = styled.div`
  display: flex;
  flex-direction: column;

  width: 100%;
`;

const SectionTitle = styled.div`
  color: ${mainTheme.textGrey};

  ${H1Style}
`;
